import React from 'react'

export const EmptyCartScreen = () => {
    return (
        <div className="empty-cart">
            Your Cart is Empty Go Back 
            className="back-to-result">
        <Link to="/">Back to result</Link>
      
        </div>
    )
}

export default EmptyCartScreen;
